$(document).ready(function(){

	var header_height = $('#header').height();

	/* parallax header */
	function parallax(){
	  var scrolled = $(window).scrollTop();
	  $('#header .backstretch img').css('top',''+-(scrolled*0.6)+'px');
      $('.heading').css('background-position', 'center '+-(scrolled*0.5)+'px');
	}


    /* backstretch slider */
    $('.header-slide').backstretch([
      "/assets/bg01-086ab61126a623d4d0a1cfb12d6a792a556029f7ddf9e4cbda04925c873f45df.jpg",
      "/assets/bg02-4ad144e42a110110fb5f6bbb36031e6bb4d244e450d8da68d80b727d9392e9c1.jpg",
      "/assets/bg03-c6d4d9d7a6675ff7b8ba87697f84fed2deda049f75f7549e9f727c66bff647a0.jpg" 
      ], {
        fade: 850,
        duration: 4000
    });


    /* navbar */
	$(window).scroll(function(){
		parallax();
		if($(window).scrollTop() > header_height){
            //$('.navbar').css('border-bottom-color', '#37bc9b');
		}else{
            //$('.navbar').css('border-bottom-color', '#fff');
		}
	});


    /* nice scroll */
    $( 'html' ).niceScroll({
        cursorcolor: '#434a54',
        cursorwidth: '10px',
        cursorborder: '1px solid #434a54',
        cursoropacitymax: 0.3,                
        scrollspeed: 35,
        zindex: 106
    });


    /* carousel testimony */
    /*
    $('#testislider').jcarousel({
        interval: 6000
    })
    */

	/* carousel partner */
    /*
	var jcarousel = $('.jcarousel');

    jcarousel
        .on('jcarousel:reload jcarousel:create', function () {
            var width = jcarousel.innerWidth();

            if(width >= 992){
            	width = width / 5;
            } else if (width >= 768) {
                width = width / 4;
            } else if (width >= 480) {
                width = width / 3;
            } else if(width >= 350){
            	width = width / 2;
            }

            jcarousel.jcarousel('items').css('width', width + 'px');
        })
        .jcarousel({
            wrap: 'circular'
        });

    $('.jcarousel-control-prev')
        .jcarouselControl({
            target: '-=1'
        });

    $('.jcarousel-control-next')
        .jcarouselControl({
            target: '+=1'
    	});

    $('.jcarousel-pagination')
        .on('jcarouselpagination:active', 'a', function() {
            $(this).addClass('active');
        })
        .on('jcarouselpagination:inactive', 'a', function() {
            $(this).removeClass('active');
        })
        .on('click', function(e) {
            e.preventDefault();
        })
        .jcarouselPagination({
            perPage: 1,
            item: function(page) {
                return '<a href="#' + page + '">' + page + '</a>';
        }
    });
    */

    /* scrolltop */
    $('.scroltop').on('click', function(event) {
        var $anchor = $(this);
        $('html, body').stop().animate({
            scrollTop: $($anchor.attr('href')).offset().top
        }, 1500, 'easeInOutExpo');
        event.preventDefault();
    });


    /* masonry layout */
    var $container = $('.container-realestate');
    $container.imagesLoaded( function(){
        $container.masonry();
    });


    /* modal */
    $('.modal').on('shown.bs.modal', function () {
        var curModal = this;
        $('.modal').each(function(){
            if(this != curModal){
                $(this).modal('hide');
            }
        });
    });


    /* tooltip */
    //$('[rel="tooltip"]').tooltip();


    /* map contact */
    /*
    $("#map").gmap3({
        map: {
            options: {
              center: [-7.866315,110.389574],
              zoom: 12,
              scrollwheel: false
            }  
         },
        marker:{
            latLng: [-7.866315,110.389574],
            options: {
             icon: new google.maps.MarkerImage(
               "https://dl.dropboxusercontent.com/u/29545616/Preview/location.png",
               new google.maps.Size(48, 48, "px", "px")
             )
            }
         }
    });
*/


    /* carousel single */
    /*
    $('#slider-property').jcarousel({
        interval: 6500
    })
    */


    /* map property */
    $('a[href="#location"]').on('shown.bs.tab', function(){
        $("#map-property").gmap3({
            map: {
                options: {
                  center: [-7.866315,110.389574],
                  zoom: 13,
                  scrollwheel: false
                }  
             },
            marker:{
                latLng: [-7.866315,110.389574],
                options: {
                 icon: new google.maps.MarkerImage(
                   "https://dl.dropboxusercontent.com/u/29545616/Preview/location.png",
                   new google.maps.Size(48, 48, "px", "px")
                 )
                }
             }
        });
    })

    $(".mensajes-especiales li").css('background', function () { //or for code's consistency, i'd use background-color instead
        return "#"+$(this).data('color')
    });


    $('#mycarousel').jcarousel({
    })
    .jcarouselAutoscroll({
        autostart: true,
        interval: 1000,
        target: '+=1'
    })


});
(function() {
  $(function() {
    var canton_id, distrito_id, params;
    $('#provincia_id').change(function() {
      var provincia_id;
      if ($(this).val().length > 0) {
        $('#distrito_id').hide();
        provincia_id = $(this).children(':selected').data('provincia-id');
        $('#canton_id_copy').clone(true).attr({
          'id': 'canton_id',
          'name': 'canton_id'
        }).replaceAll('#canton_id');
        $('#canton_id option').each(function() {
          $(this).show();
          if ($(this).val().length > 0 && $(this).data('provincia-id') !== provincia_id) {
            return $(this).remove();
          }
        });
        return $('#canton_id').show();
      } else {
        $('#distrito_id').hide();
        $('#canton_id').hide();
        return $('#canton_id').val('');
      }
    });
    $('#canton_id_copy').change(function() {
      var canton_id, provincia_id;
      if ($(this).val() && $(this).val().length > 0) {
        provincia_id = $('#provincia_id').children(':selected').data('provincia-id');
        canton_id = $(this).children(':selected').data('canton-id');
        $('#distrito_id_copy').clone(true).attr({
          'id': 'distrito_id',
          'name': 'distrito_id'
        }).replaceAll('#distrito_id');
        $('#distrito_id option').each(function() {
          $(this).show();
          if ($(this).val().length > 0 && !($(this).data('provincia-id') === provincia_id && $(this).data('canton-id') === canton_id)) {
            return $(this).remove();
          }
        });
        return $('#distrito_id').show();
      } else {
        $('#distrito_id').val('');
        return $('#distrito_id').hide();
      }
    });
    if ($('#provincia_id').size() > 0 && $('#provincia_id').val().length > 0) {
      $('#provincia_id').change();
      params = $.getQueryParameters();
      canton_id = params['canton_id'].replace(/\+/g, ' ');
      if (canton_id.length > 0) {
        $('#canton_id').val(canton_id);
        $('#canton_id').change();
        distrito_id = params['distrito_id'].replace(/\+/g, ' ');
        if (distrito_id.length > 0) {
          $('#distrito_id').val(distrito_id);
        }
      }
    }
    return $('.listado-control').change(function() {
      return $(this).parents('form').submit();
    });
  });

}).call(this);
